  const response = await fetch("https://api.nasa.gov/planetary/apod?api_key=REW9S4Wo1MndGqSHneavKJemmjxI5bgNLqfgv0aT");
  const result = await response.json();
  return result.hdurl
}






const Left=(getData)=> {
  return (<div className = "Left"><a src ={getData()} alt ="Generic company logo that covers the whole left side"/></div>)
} 

export default Left;
